import Slider from "../components/Slider";

function Home() {
  const name = "Chandan";

  const maskStyles = {
    width: "300px",
    height: "300px",
    background: "url('/images/your-image.jpg') center/cover no-repeat",
    WebkitMaskImage: "url('/images/mask-shape.png')",
    maskImage: "url('/images/mask-shape.png')",
    WebkitMaskSize: "cover",
    maskSize: "cover",
    WebkitMaskRepeat: "no-repeat",
    maskRepeat: "no-repeat",
    WebkitMaskPosition: "center",
    maskPosition: "center",
  };

  return (
    <div className="">
      <Slider />
      <h1 className="text-3xl font-bold text-blue-600">
        Welcome to Home Page
      </h1>
      <div style={maskStyles}></div>
    </div>
  );
}

export default Home;
